import React, { Component, useState } from "react";
import {
  StyleSheet,
  View,
  Text,
  TouchableOpacity,
  TouchableWithoutFeedback,
  useWindowDimensions,
  Switch,
  TextInput,
} from "react-native";
import { Feather } from "@expo/vector-icons";
import { updateData } from "state/firebaseFunctions";
import { setUserStoreState, userStoreState } from "state/state";

function AddCategoryModal({ setaddCategoryModal, existingCategory, index }) {
  const { height, width } = useWindowDimensions();
  const [categoryName, setcategoryName] = useState(
    existingCategory ? existingCategory : ""
  );
  const [categoryPosition, setcategoryPosition] = useState(index);
  const catalog = userStoreState.use();

  const Update = () => {
    const localCatalog = structuredClone(catalog);
    const newCategories = [];
    localCatalog.categories.filter((category) => category !== existingCategory);
    if (localCatalog.categories.length > 0) {
      localCatalog.categories.forEach((category, index) => {
        if (index === categoryPosition) {
          newCategories.push(categoryName);
          newCategories.push(category);
        } else {
          newCategories.push(category);
        }
      });
    } else {
      newCategories.push(categoryName);
    }
    updateData(newCategories);
    setUserStoreState({ ...catalog, categories: newCategories });
    setaddCategoryModal(false);
    //make it update online store too
  };

  return (
    <TouchableOpacity
      onPress={() => setaddCategoryModal(false)}
      style={{
        justifyContent: "center",
        alignItems: "center",
        height: height,
        width: width,
      }}
      activeOpacity={1}
    >
      <TouchableWithoutFeedback>
        <div style={{ cursor: "default" }}>
          <View style={styles.container}>
            <Text style={styles.addCategoryTxt}>Add Category</Text>
            <View style={styles.bottomContainer}>
              <View style={styles.nameAndPosRow}>
                <View style={styles.categoryNameGroup}>
                  <TextInput
                    style={styles.categoryNameLbl}
                    placeholder="Enter Category Name"
                    value={categoryName}
                    onChangeText={(val) => setcategoryName(val)}
                  />
                  <View style={styles.categoryNameInput}></View>
                </View>
                <View style={styles.categoryPositionGroup}>
                  <Text style={styles.categoryPosition}>Category Position</Text>
                  <View style={styles.minusPlusSelectorRow}>
                    <TouchableOpacity
                      activeOpacity={0.8}
                      style={styles.minusContainer}
                      onPress={() =>
                        setcategoryPosition((prev) =>
                          prev !== 0 ? prev - 1 : prev
                        )
                      }
                    >
                      <Feather name="minus" style={styles.minusIcon} />
                    </TouchableOpacity>
                    <View style={styles.indexContainer}>
                      <Text style={styles.text}>{categoryPosition}</Text>
                    </View>
                    <TouchableOpacity
                      activeOpacity={0.8}
                      style={styles.plusContainer}
                      onPress={() =>
                        setcategoryPosition((prev) =>
                          prev !== catalog.categories.length - 1
                            ? prev + 1
                            : prev
                        )
                      }
                    >
                      <Feather name="plus" style={styles.plusIcon} />
                    </TouchableOpacity>
                  </View>
                </View>
              </View>
              <View style={styles.displayOnlineRow}>
                <Text style={styles.displayOnlineStoreTxt}>
                  Display On online store?:
                </Text>
                <Switch value={true} />
              </View>
              <View style={styles.btnsRow}>
                <TouchableOpacity
                  activeOpacity={0.8}
                  onPress={() => setaddCategoryModal(false)}
                  style={styles.cancelBox}
                >
                  <Text style={styles.cancelTxt}>Cancel</Text>
                </TouchableOpacity>
                <TouchableOpacity
                  activeOpacity={0.8}
                  onPress={Update}
                  style={styles.saveBox}
                >
                  <Text style={styles.saveTxt}>Save</Text>
                </TouchableOpacity>
              </View>
            </View>
          </View>
        </div>
      </TouchableWithoutFeedback>
    </TouchableOpacity>
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: "#ffffff",
    borderRadius: 10,
    alignItems: "center",
    justifyContent: "flex-start",
    width: 511,
    height: 582,
  },
  addCategoryTxt: {
    fontWeight: "700",
    color: "#121212",
    fontSize: 21,
    marginTop: 40,
    marginBottom: 40,
  },
  bottomContainer: {
    width: 377,
    height: 321,
    justifyContent: "space-between",
    alignItems: "center",
  },
  nameAndPosRow: {
    width: 377,
    height: 77,
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
  },
  categoryNameGroup: {
    width: 197,
    height: 77,
    justifyContent: "space-between",
  },
  categoryNameLbl: {
    color: "#121212",
    fontSize: 17,
  },
  categoryNameInput: {
    width: 197,
    height: 50,
    backgroundColor: "#ffffff",
    borderRadius: 5,
    borderWidth: 1,
    borderColor: "#9b9b9b",
  },
  categoryPositionGroup: {
    width: 150,
    height: 77,
    justifyContent: "space-between",
  },
  categoryPosition: {
    color: "#121212",
    fontSize: 17,
  },
  minusPlusSelectorRow: {
    width: 150,
    height: 50,
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
  },
  minusContainer: {
    width: 50,
    height: 50,
    backgroundColor: "rgba(179,179,179,1)",
    borderTopLeftRadius: 10,
    borderBottomLeftRadius: 10,
    alignItems: "center",
    justifyContent: "center",
  },
  minusIcon: {
    color: "rgba(255,255,255,1)",
    fontSize: 35,
  },
  indexContainer: {
    width: 50,
    height: 50,
    backgroundColor: "#E6E6E6",
    alignItems: "center",
    justifyContent: "center",
  },
  text: {
    fontWeight: "700",
    color: "#121212",
    fontSize: 20,
  },
  plusContainer: {
    width: 50,
    height: 50,
    backgroundColor: "rgba(179,179,179,1)",
    borderTopLeftRadius: 0,
    borderBottomLeftRadius: 0,
    borderTopRightRadius: 10,
    borderBottomRightRadius: 10,
    alignItems: "center",
    justifyContent: "center",
  },
  plusIcon: {
    color: "rgba(255,255,255,1)",
    fontSize: 35,
  },
  displayOnlineRow: {
    width: 377,
    height: 20,
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "flex-start",
  },
  displayOnlineStoreTxt: {
    color: "#121212",
    textDecorationLine: "underline",
    fontSize: 17,
    marginRight: 40,
  },
  switchBox: {
    width: 42,
    height: 20,
    backgroundColor: "#E6E6E6",
    borderRadius: 10,
  },
  btnsRow: {
    width: 377,
    height: 47,
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
  },
  cancelBox: {
    width: 173,
    height: 47,
    backgroundColor: "#eef2ff",
    borderRadius: 20,
    shadowColor: "#f0f0f0",
    shadowOffset: {
      width: 3,
      height: 3,
    },
    elevation: 60,
    shadowOpacity: 1,
    shadowRadius: 20,
    justifyContent: "center",
    alignItems: "center",
  },
  cancelTxt: {
    fontWeight: "700",
    color: "#1c294e",
    fontSize: 20,
  },
  saveBox: {
    width: 173,
    height: 47,
    backgroundColor: "#1c294e",
    borderRadius: 20,
    shadowColor: "#d8d8d8",
    shadowOffset: {
      width: 3,
      height: 3,
    },
    elevation: 60,
    shadowOpacity: 1,
    shadowRadius: 20,
    alignItems: "center",
    justifyContent: "center",
  },
  saveTxt: {
    fontWeight: "700",
    color: "#eef2ff",
    fontSize: 20,
  },
});

export default AddCategoryModal;
